import React from "react";
import facebook from "../assets/facebook.png";
import google from "../assets/google.png";
import apple from "../assets/apple.png";

const SignIn = () => {
  return (
    <div className="h-screen w-screen flex flex-col justify-center items-center border border-black">
      {/*heading  */}
      <div className="flex flex-col w-[80%]">
        {/* heading */}
        <div className="">
          <h1 className="text-[1.5rem] lg:text-[1.75rem] non-italic text-[#69235B] font-bold leading-5 text-center">
            <span className="relative before:absolute before:z-[-100] before:top-[70%] before:left-0 before:bg-[#FFC746] before:w-[106%] before:h-[35%]">
              Log in
            </span>{" "}
            to Mokx
          </h1>
        </div>
        {/* paragraph */}
        <div className="mt-4">
          <p className="text-[#69235B] text-center text-[0.875rem] md:text-[1rem] lg:text-[1.125rem] font-light leading-5 tracking-[0.00625rem]">
            Welcome back! Sign in using your social account or email to continue
            us
          </p>
        </div>
        {/* Authentication - FaceBook,Google,Apple */}
        <div className="mt-6  flex justify-center space-x-[1.5rem]">
          <div className="rounded-full border border-black h-[2.875rem] w-[2.875rem]">
            <img src={facebook} alt="" className="h-full w-full " />
          </div>
          <div className="rounded-full border border-black h-[2.875rem] w-[2.875rem]">
            <img src={google} alt="" className="h-full w-full " />
          </div>
          <div className="rounded-full border border-black h-[2.875rem] w-[2.875rem]">
            <img src={apple} alt="" className="h-full w-full" />
          </div>
        </div>
      </div>
      <div className="w-[70%] md:w-[65%] lg:w-[45%] my-10 flex items-center before:border-t-2 before:border-[#CDD1D0] before:z-0 before:w-[45%] after:border-t-2 after:border-[#CDD1D0] after:w-[45%]">
        <p className="text-center mx-4 tracking-[0.00625rem] leading-5 font-thin text-[1.125rem] text-[#69235B]">
          OR
        </p>
      </div>

      {/* foam */}
      <div></div>
    </div>
  );
};

export default SignIn;
